import React from 'react';

const Button = ({ onClick, className = '', type = 'submit', full = false, children, ...props }) => {
  return (
    <button
      type={type}
      onClick={onClick}
      className={`${className} ${full ? 'w-full' : ''}`}
      {...props}
    >
      {children}
    </button>
  );
};

export default Button;
